import React, {useState} from "react"
import Menu from '../components/Menu';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../components/Style.css'
import './css/Castracao.css'

function Castracao() {
  
    const [ datetime, setDatetime ] = useState();

    function handleChange(ev) {
        if (!ev.target['validity'].valid) return;
        const dt= ev.target['value'];
        setDatetime(dt)
      }
      
    return (
        <div>
            <Menu />
          
            
                <label className="formulario">
                    
                    <div className="div-esquerda">
                        <ul className="info">
                            <li><input type="text" placeholder=""/></li>
                            <li><input type="number" placeholder="" className="number"/></li>
                            <li><input type="tel"/></li>
                            <li><input type="text"/></li>
                        </ul>
                    </div>
                    <div className="div-esquerda">
                        <ul className="info">
                        <li><input type="number"className="number"/></li>
                        <li><input type="number"className="number"/></li>
                        </ul>
                    </div>
                </label>    
             

             
        </div>
    );






}


export default Castracao;
